INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130011, 3001100, 2, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "ヤマト", 100, 2.1, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 3001);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130011, 3001101, 2, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "ヤマト", 101, 5.68, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 4, 3001);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130011, 3001102, 1, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "ヤマト", 102, 0.0, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 3001);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130211, 3002100, 1, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "フブキ", 100, 0.0, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 3002);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130211, 3002101, 1, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "フブキ", 101, 0.0, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 3002);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130211, 3002102, 2, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "フブキ", 102, 8.53, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 5, 3002);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130211, 3002103, 1, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "フブキ", 103, 5.67, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 7, 3002);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130211, 3002104, 1, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "フブキ", 104, 0.0, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 3002);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130211, 3002300, 3, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "フブキ", 300, 0.0, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 3, 3004);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130211, 3002400, 7, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "フブキ", 301, 0.0, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 7, 3005);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130211, 3003200, 1, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "フブキ", 200, 4.4, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 2, 3003);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130211, 3003201, 7, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "フブキ", 201, 0.0, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 7, 3003);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (130211, 3003202, 2, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "フブキ", 202, 5.6, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 3003);
